import './App.css';
import {Route,Routes,useLocation} from "react-router-dom";
import MSLogin from './pages/login/MSLogin';
import msRegister from './pages/register/register';
import Header from "./header/header";
import Header2 from './header2/header2';
import WalletConnection from './features/walletConnection/Wallet';
import Check from './pages/check/check';
import ProjectDetails from './NewProject/ProjectDetails/ProjectDetails';


function App() {

  // const pathName = useLocation();
  // console.log(pathName);
  // const path = pathName.pathname;


  return (

    <div className="App">
      {/* {path === "/login" || path === "/walletConnection" ? <Header userName={pathName} /> : <Header2 userName={pathName.state === null ? "" : pathName.state} />}
       */}
      <Routes>
        {/* <Route path="/check" element={<Check />}></Route> */}
        <Route path="/login" element={<MSLogin />}></Route>
        <Route path="/register" element={<msRegister />}></Route>
        <Route path="/walletConnection" element={<WalletConnection />}></Route>
        <Route path="/list" element={<msListCard />}></Route>
        <Route path="/filter" element={<msFilter />}></Route>
        <Route path="/projectDetails" element={<ProjectDetails />}></Route>
        <Route path="/attachment" element={<msAttachments />}></Route>
        <Route path="/datePicker" element={<msDatePicker />}></Route>
        <Route path="/dropdown" element={<msDropdown />}></Route>
        <Route path="/upload" element={<MuiFileUploader />}></Route>
        <Route path="/listdiv" element={<ListDividers />}></Route>
      </Routes>
    </div>  
  );
}



export default App;
